import React from 'react';

export default function Item(props) {
  return (
    <tr>
      <th className="order-items-1">{props.item.qnt}</th>
      <th className="order-items-2">{props.item.item}</th>
      <th className="order-items-3">{props.item.price}</th>
    </tr>
  );
}
